import 'package:app_rick/config/api/api_service.dart';
import 'package:app_rick/futures/home/models/custom_info_model.dart';
import 'package:app_rick/futures/home/models/episode_model.dart';
import 'package:app_rick/futures/home/models/info_character.dart';
import 'package:intl/intl.dart';

class HomeService {
  static Future<List<InfoCharacter>> getCharacter({required List ids}) async {
    List<InfoCharacter> characters = [];
    final resp =
        await ApiServices().getRick(path: 'character/${ids.join(',')}');
    for (var element in resp.data) {
      final character = InfoCharacter.fromMap(element);
      characters.add(character);
    }
    return characters;
  }

  static Future<EpisodesModelCharacter> getEpisode({required String id}) async {
    final resp = await ApiServices().getRick(path: 'episode/$id');
    return EpisodesModelCharacter.fromMap(resp.data);
  }

  static Future<List<CustomInfoModel>> customGet({required List ids}) async {
    List<CustomInfoModel> info = [];
    final DateFormat formatter = DateFormat('dd/MM/yyyy');
    final listCha = await getCharacter(ids: ids);
    for (var element in listCha) {
      final lastElement = element.episode[0].toString().split('/');
      final epi = await getEpisode(id: lastElement.last);
      info.add(CustomInfoModel(
          id: element.id,
          name: element.name,
          imagerul: element.image,
          image:
              "data:image/jpeg;base64,",
          species: element.species,
          episodeName: epi.name,
          airDate: formatter
              .format(DateFormat('MMMM d, y', 'en_US').parse(epi.airDate))));
    }
    return info;
  }

  static postCharacter(List<CustomInfoModel> lisstInfo) async {
    for (var element in lisstInfo) {
       await ApiServices().postPluto(data: element.toMap());

    }
  }
}
